webpackJsonp([0x7baa7872cade],{4007:function(a,n){a.exports={data:{markdownRemark:{html:'<p>東方弾幕風フレームワークライブラリ『<a href="/tag/flan">Framework of LunAtic Notation</a>』のバージョン0.1aをリリースしました。今回の更新で定型弾機能及び内分カウンタ機能の大幅な整理及び追加をしました。</p>\n<h2>17:45追記</h2>\n<p>東方弾幕風フレームワークライブラリ『<a href="/tag/flan">Framework of LunAtic Notation</a>』のバージョン0.1bをリリースしました。 0.1aにて追加した機能がいろいろとバグ満載だったのでいろいろと修正しました。また、新関数を2つ搭載しました。 ところで気づけば夏コミもあと1週間なので、改めて頒布リストを整理してみます。 <a href="/!/thA/">東方時封城</a>の続編STGです。次回冬コミC71の完成に向けて製作中ですが、その体験版で<a href="http://www.reitaisai.com/">博麗神社例大祭3</a>にて頒布したものの更新バージョンとなります。<a href="/!/thC/">東方夢終劇 ～ Conceal the Conclusionの詳細はこちら</a>。頒布価格は100円です。体験版A(例大祭版)の簡易ジャケットを持参の方には無償で頒布いたします。(但し、簡易ジャケットと引き換え、と言う形になりますのでご了承願います)また、当日11:20頃からデモリプレイムービーを再生します(開催直後から再生したいところですが自分のノートPCはバッテリの持ちがお世辞にも良くないのでorz)</p>\n<h2>(委託)東方キーホルダー</h2>\n<p><del>東方キーホルダーの詳細はこちら</del>。30個限定、頒布価格は500円となります。今回限りの突発頒布につき再販は現状ないそうです。</p>\n<h2>Leila Prismriver</h2>\n<p>前回冬コミC69の再販となります。<a href="/!/leila/">Leila Prismriverの詳細はこちら</a>。頒布価格は300円です。</p>\n<h2>東方キャラA5ラミカ</h2>\n<p>上記3つを同時にご購入の方に1枚無料で進呈します。先着8枚のみで、なくなり次第終了となります。絵柄は妖夢(3枚)・魔理沙(2枚)・秘封倶楽部(2枚)の3種類です。(2006/3/26の<a href="http://www.h4.dion.ne.jp/%7Ewashoi/">オールジャンル即売会「わっしょい」</a>にて頒布したものです)</p>\n<h2>体験版A2→体験版Bの更新点</h2>\n<ul>\n<li>シナリオが2ルートから4ルートに増えました</li>\n<li>合わせてBGMが13曲(例大祭版は15曲)から25曲に増えました</li>\n<li>ボーナスアイテムを新設(現時点では単なるボーナスアイテムですが、完全版ではストーリー上重要なアイテムとなります)</li>\n<li>旧来までのシナリオA/Cの難易度調整をしました</li>\n<li>ラストスペル条件の調整をしました</li>\n</ul>',frontmatter:{cover:null,date:"2006-08-06T00:00:00+09:00",strDate:"2006/8/5",title:"夏コミ詳細"}}},pathContext:{path:"/ja/blog/2006/08/06-夏コミ詳細/",langKey:"ja"}}}});
